public class InnerTemplateDefaultNewSheetConfigurationFactory(Action<Humidifier.QuickSight.TemplateTypes.DefaultNewSheetConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.TemplateTypes.DefaultNewSheetConfiguration>
{

    internal InnerTemplateDefaultInteractiveLayoutConfigurationFactory InteractiveLayoutConfigurationFactory { get; set; }

    internal InnerTemplateDefaultPaginatedLayoutConfigurationFactory PaginatedLayoutConfigurationFactory { get; set; }

    protected override Humidifier.QuickSight.TemplateTypes.DefaultNewSheetConfiguration Create()
    {
        var defaultNewSheetConfigurationResult = CreateDefaultNewSheetConfiguration();
        factoryAction?.Invoke(defaultNewSheetConfigurationResult);

        return defaultNewSheetConfigurationResult;
    }

    private Humidifier.QuickSight.TemplateTypes.DefaultNewSheetConfiguration CreateDefaultNewSheetConfiguration()
    {
        var defaultNewSheetConfigurationResult = new Humidifier.QuickSight.TemplateTypes.DefaultNewSheetConfiguration();

        return defaultNewSheetConfigurationResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.TemplateTypes.DefaultNewSheetConfiguration result)
    {
        base.CreateChildren(result);

        result.InteractiveLayoutConfiguration ??= InteractiveLayoutConfigurationFactory?.Build();
        result.PaginatedLayoutConfiguration ??= PaginatedLayoutConfigurationFactory?.Build();
    }

} // End Of Class

